import React, { Component } from 'react';
import styles from './resumeList.module.scss';

export default ({ experienceDate }) => {
    return <div>
            {
               experienceDate.map(item => 
                <ul className= { styles.card }>
                    <li key={item.id}>
                        <div>{item.time}</div>
                        <div>{item.role}</div>
                        <div>{item.company}</div>
                        <div>{item.location}</div>
                        <div>{item.desc}</div>
                    </li>
                    </ul>
                )
            }
    </div>
}
